import Login from "../pages/Login/Login";
import { validateToken } from "./../hooks/authApi.js";
import { getValidToken } from "./../hooks/https.js";

function RedirectTo({ children }) {
    getValidToken();
    validateToken()
    .then(response => {
        let data = response.data;
        if(data.success)
            return <children/>;
        else
            return <Login/>;
    })
    .catch(err => {
        console.log(err);
    });
}

export default RedirectTo;
